(3, 7, 163, '2018-02-20 00:00:00', '45.65000000', '0.15000000', 'Le canard mandarin mâle a le dessus de la tête vert et roux cuivré, les joues partiellement blanches, le bec rouge. Une touffe de grandes plumes orange dressées, en forme d\'éventail, retombe sur le haut des ailes. Une double ligne blanche accolée d\'une double ligne noire encadre les côtés de la poitrine brune et blanche. Le ventre blanc précède une queue relativement longue et noire. Enfin, les plumes ornementales brun-orange des ailes sont des rémiges tertiaires, ses ailerons lui ont valu le nom scientifique de galericulata qui en latin signifie \'galère\'.\r\nLe dimorphisme sexuel est très marqué. En effet, contrairement au mâle, la femelle a un plumage terne, presque entièrement brune avec le ventre blanc. Seules quelques petites taches pâles viennent éclaircir cette sombre ordonnance : une barre blanche derrière le bec, un cercle oculaire blanc poursuivi par une ligne courbe blanche partant du bas de l\'oeil.\r\n\r\nMythologie - Symboles : En Chine, le canard mandarin était un oiseau sacré,', 1),
